FeedPackage.ReleaseNotes:
Action4LogFilter - Implementação do log de warning quando o tempo de execução for superior a X segundos;
Action4LogFilter - Acrescimo da funcionalidade de logar os argumentos;
Action4LogFilter e Arguments4LogFilter - Possibilidade de alterar as mensagens de inicio, fim e argumentos registradas em log;

Implementação do IgnoreLogAttribute e alteração dos filtros para desconsiderar o log nas controllers/actions que possuam o novo atributo;
Modificação no comportamento do Action4LogFilter para logar os argumentos utilizando o logger padrão do filtro;
Modificação no comportamento do método GetLogContext para ignorar o contexto completo quando este já foi persistido;
Adição no contexto da mensagem de erro e seu tipo que serão adicionados no log de finalização com falha de uma ação;
Implementação dos métodos extendidos log4net.ILog.GetLogLevel e log4net.ILog.SetLogLevel;
